export enum FilterType{
    name='name',
    views='views',
    lastViewed='lastViewed',
    owner='owner',
    type='type'
}

export enum FilterOperatorType{
    equalTo='equalTo',
    lessThan='lessThan',
    greaterThan='greaterThan'
}

export enum FilterOperator {
    contains='contains',
    '>'='>',
    '<'='<',

}



export function getFilterOperators(filterType:FilterType){
    switch (filterType){
        case FilterType.name:
            return [FilterOperator.equalTo]
        case FilterType.views:
            return [FilterOperator.lessThan, FilterOperator.greaterThan]
        case FilterType.lastViewed:
            return [FilterOperator.lessThan, FilterOperator.greaterThan]
        case FilterType.owner:
            return [FilterOperator.equalTo]
        case FilterType.type:
            return [FilterOperator.equalTo]
    }
}

export const allFilters:string[] = Object.values(FilterType);

export type SearchFilter = {
    filterType:FilterType|null,
    value:string|null,
    operator: FilterOperator
}
